import React,{useState} from 'react'

export default function Product() {

    // se usa para mostrar el icono y titulo de las opciones de cada producto
    const [opciones,setopciones]=useState(false);
    // ======================================================

    // almacena el estado del chek para mostrar u ocultar los componentes de editar precio
    const [estadoCheck, setCheck]=useState(false);
    
    function changeCheck(){
        var estadoI= document.getElementById("chk_state");
        setCheck(estadoI.checked);
    }
    // =============================================================

    // Muestra los botones de accion
    const [buttonE, setButtonE] = useState(true);
    const [buttonA, setButtonA] = useState(false);

    function actions(){
        setButtonE(false);
        setButtonA(true);

        // var save = document.getElementById("btnSave");
        // var cancel = document.getElementById("btnCancel");
    }
    
    return (
        <div className="content-wrapper">
            <div className="pt-3">
                <div className="container-fluid">
                    <div className="row">
                        <div className="col-md-12">
                            <div className="card" >
                                <div className="row g-0" style={{paddingTop:10,paddingBottom:10}}>
                                    <div className='col-md-1' style={{alignSelf:"center", display:"flex", justifyContent:"center", alignItems:"center"}} >
                                        <div className="form-check " >
                                            <input className="form-check-input" type="checkbox" value="" id="flexCheckDefault"></input>
                                        </div>
                                    </div>
                                    <div className="col-md-1">
                                        <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/f/fe/Anne_Frank_lacht_naar_de_schoolfotograaf.jpg/640px-Anne_Frank_lacht_naar_de_schoolfotograaf.jpg" className="img-fluid rounded-start" alt="..." style={{height:"150px"}} ></img>
                                    </div>
                                    <div className="col-md-10">
                                        <div className="card-body" >
                                            <div className='row'>
                                                <div className='col-md-8'>
                                                    <h5 className="card-title">Nombre del producto <small className="text-muted">Last updated 3 mins ago</small></h5>
                                                        
                                                </div>
                                                <div className='col-md-2'>
                                                    <h3 id="h3Price">$140.00</h3>
                                                    <input className="text" id="txtPrice" placeholder='New Price' hidden></input>
                                                </div>
                                                <div className='col-md-2'>
                                                    <div className="btn-group" role="group" aria-label="Basic example">
                                                        <button typE="button" className="btn btn-primary" onClick={()=>actions('edit')} hidden={buttonE?(false):(true)}>Edit Product</button>
                                                        <button type="button" className="btn btn-success" onClick={()=>actions('save')} hidden={buttonA?(false):(true)}>Save Changes</button>
                                                        <button type="button" className="btn btn-danger" onClick={()=>actions('cancel')} hidden={buttonA?(false):(true)}>Cancel</button>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className='row'>
                                                <div className='col-md-3' >
                                                    <div className='input-group'style={{justifyContent:'space-between'}}>
                                                        <div className="form-check form-switch">
                                                            <input className="form-check-input" onClick={()=>changeCheck()} type="checkbox" id="chk_state"></input>
                                                            <label className="form-check-label" htmlFor="chk_state">{
                                                                estadoCheck?"Activado":"Desactivado"
                                                            }</label>
                                                        </div>
                                                        <h6><label>Available:</label><label>19</label></h6>
                                                    </div>
                                                    
                                                </div>
                                            </div>
                                            {
                                                opciones?(<div className='row'>
                                                    <div className='col-md-12'>
                                                        <a href='google.com'><i className="far fa-clone"></i> <label>Opciones</label></a>
                                                    </div>
                                                </div>
                                                ):(null)
                                            }
                                            
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );

    
}
